import React from "react";
import FormControl from "@material-ui/core/FormControl";
import Box from "@material-ui/core/Box";
import Grid from "@material-ui/core/Grid";
import Question from "./Question";
export default function RadioButtons({
  data,
  setValues2,
  summary,
  setSummary,
  content,
  setContent,
  data1,
}) {
  function getPoint(id) {
    var point;
    point = id + 1.0;
    return point;
  }

  function X1_1() {
    var sum, x;
    sum =
      getPoint(data[0].value) +
      getPoint(data[1].value) +
      getPoint(data[2].value) +
      getPoint(data[3].value) +
      getPoint(data[4].value) +
      getPoint(data[5].value) +
      getPoint(data[6].value) +
      getPoint(data[7].value) +
      getPoint(data[8].value);
    x = sum / 9;

    return x;
  }

  function X2_1() {
    var sum, x;
    sum =
      getPoint(data[9].value) +
      getPoint(data[10].value) +
      getPoint(data[11].value) +
      getPoint(data[12].value) +
      getPoint(data[13].value);
    x = sum / 5;

    return x;
  }
  function X3_1() {
    var sum, x;
    sum =
      getPoint(data[14].value) +
      getPoint(data[15].value) +
      getPoint(data[16].value) +
      getPoint(data[17].value) +
      getPoint(data[18].value) +
      getPoint(data[19].value);
    x = sum / 6;

    return x;
  }
  function X4_1() {
    var sum, x;
    sum =
      getPoint(data[20].value) +
      getPoint(data[21].value) +
      getPoint(data[22].value) +
      getPoint(data[23].value) +
      getPoint(data[24].value) +
      getPoint(data[25].value) +
      getPoint(data[26].value) +
      getPoint(data[27].value);

    x = sum / 8;

    return x;
  }
  function X5_1() {
    var sum, x;
    sum =
      getPoint(data[28].value) +
      getPoint(data[29].value) +
      getPoint(data[30].value) +
      getPoint(data[31].value);

    x = sum / 4;

    return x;
  }
  function X6_1() {
    var sum, x;
    sum =
      getPoint(data[32].value) +
      getPoint(data[33].value) +
      getPoint(data[34].value) +
      getPoint(data[35].value) +
      getPoint(data[36].value);

    x = sum / 5;

    return x;
  }
  function X7_1() {
    var sum, x;
    sum =
      getPoint(data[37].value) +
      getPoint(data[38].value) +
      getPoint(data[39].value) +
      getPoint(data[40].value);
    x = sum / 4;

    return x;
  }
  function X8_1() {
    var sum, x;
    sum =
      getPoint(data[41].value) +
      getPoint(data[43].value) +
      getPoint(data[43].value);

    x = sum / 3;

    return x;
  }
  function X9_1() {
    var sum, x;
    sum = getPoint(data[44].value) + getPoint(data[45].value);
    x = sum / 2;

    return x;
  }

  const handleChange = (value, index) => {
    const newArray = [...data];
    newArray[index].value = value;

    newArray[index].value = value;

    const newContent = [...content];
    newContent[0].d0 = X1_1().toFixed(0);
    newContent[1].d0 = X2_1().toFixed(0);
    newContent[2].d0 = X3_1().toFixed(0);
    newContent[3].d0 = X4_1().toFixed(0);
    newContent[4].d0 = X5_1().toFixed(0);
    newContent[5].d0 = X6_1().toFixed(0);
    newContent[6].d0 = X7_1().toFixed(0);
    newContent[7].d0 = X8_1().toFixed(0);
    newContent[8].d0 = X9_1().toFixed(0);
    setContent(newContent);

    setValues2(newArray);
  };
  var count = 0;
  const renderQuestions = () => {
    // eslint-disable-next-line
    return data1.users.map((question, index) => {
      if (question.dim === 1) {
        var count = count + 1;
      }
      if (question.dim === 2) {
        return (
          <Grid container xs={12} key={index}>
            {console.log(count)}
            <Question
              index={index}
              no={question.no}
              value={data[index - count].value}
              header={question.q1}
              description={question.q2}
              sub1={question.s1}
              sub2={question.s2}
              dim={question.dim}
              handleChange={(e) => handleChange(e, index - 41)}
            />
          </Grid>
        );
      }
    });
  };
  return (
    <div>
      <Box bgcolor="background.paper" spacing={10}>
        <FormControl component="fieldset">{renderQuestions()}</FormControl>
      </Box>
    </div>
  );
}
